function genererOptionsPays() {
    const selectPays = document.getElementById("pays");
    tarifs.forEach(pays => {
        const option = document.createElement("option");
        option.value = pays.pays;
        option.text = pays.pays;
        selectPays.appendChild(option);
    });
}

function calculerTarifs() {
    const paysSelectionne = document.getElementById("pays").value;
    const forfaitSelectionne = document.querySelector("input[name='forfait']:checked");
    
    if (!forfaitSelectionne) {
        alert("Veuillez sélectionner un forfait.");
        return;
    }
    
    const forfait = forfaitSelectionne.value;
    const paysTarif = tarifs.find(pays => pays.pays === paysSelectionne);
    
    if (paysTarif) {
        let tarifsAffichage = "";
        
        tarifsAffichage += `<p>Depuis ${paysSelectionne}, voici les tarifs pour les appels :</p>`;
        tarifsAffichage += `<ul>`;
        tarifsAffichage += `<li>Appel vers le pays d'émission: ${paysTarif.forfaits[forfait].emissionPays < 0 ? 'inclus' : paysTarif.forfaits[forfait].emissionPays + ' €/min'}</li>`;
        tarifsAffichage += `<li>Appel vers La France: ${paysTarif.forfaits[forfait].emissionFrance < 0 ? 'inclus' : paysTarif.forfaits[forfait].emissionFrance + ' €/min'}</li>`;
        tarifsAffichage += `<li>Appel vers Europe et DOM: ${paysTarif.forfaits[forfait].emissionEuropeDOM < 0 ? 'inclus' : paysTarif.forfaits[forfait].emissionEuropeDOM + ' €/min'}</li>`;
        tarifsAffichage += `<li>Appel vers le reste du monde: ${paysTarif.forfaits[forfait].emissionMonde < 0 ? 'inclus' : paysTarif.forfaits[forfait].appelSpecialMonde + ' €/min'}</li>`;
        tarifsAffichage += `<li>Appel reçu: ${paysTarif.forfaits[forfait].appelRecu < 0 ? 'inclus' : paysTarif.forfaits[forfait].appelRecu + ' €/min'}</li>`;
        tarifsAffichage += `</ul>`;
        tarifsAffichage += `<p>Pour le reste :</p>`;
        tarifsAffichage += `<ul>`;
        tarifsAffichage += `<li>SMS envoyé: ${paysTarif.forfaits[forfait].smsEnvoye < 0 ? 'inclus' : paysTarif.forfaits[forfait].smsEnvoye + ' €/sms'}</li>`;
        tarifsAffichage += `<li>MMS envoyé: ${paysTarif.forfaits[forfait].mmsEnvoye < 0 ? 'inclus' : paysTarif.forfaits[forfait].mmsEnvoye + ' €/mms'}</li>`;
        tarifsAffichage += `<li>MMS reçu: ${paysTarif.forfaits[forfait].mmsRecu < 0 ? 'inclus' : paysTarif.forfaits[forfait].mmsRecu + ' €/mms'}</li>`;
        tarifsAffichage += `<li>Data depuis l'étranger: ${paysTarif.forfaits[forfait].dataEtranger < 0 ? 'inclus dans la limite du cota de votre forfait puis ' + Math.abs(paysTarif.forfaits[forfait].dataEtranger) + ' €/Mo' : paysTarif.forfaits[forfait].dataEtranger + ' €/Mo'}</li>`;
        tarifsAffichage += `</ul>`;
        const resultatsDiv = document.getElementById("resultats");
        resultatsDiv.innerHTML = tarifsAffichage;
    }
}



window.onload = function() {
    genererOptionsPays();
};
